import { BrowserRouter as Router, Route } from "react-router-dom";
import AppView from "./views/AppView";
import LoginView from "./views/LoginView";
import SignUpView from "./views/SignUpView";

function App() {
  return (
    <Router>
      <Route path="/" exact>
        <AppView />
      </Route>
      <Route path="/login">
        <LoginView />
      </Route>
      <Route path="/signup">
        <SignUpView />
      </Route>
    </Router>
  );
}

export default App;
